import {React,Fragment} from 'react'
import {connect} from 'react-redux'
import './Spinner.css'
const Spinner = () => {
    return (
        <Fragment>
            <img src="./../../img/Spinner-1s-200px.gif" class="spinner" alt="loading">
            </img>
        </Fragment>
    )
}
const mapPropToState = state =>({
    profile : state.profile,
    isAuthenticaed : state.auth.isAuthenticaed
})
export default connect(mapPropToState)(Spinner)
